import React from 'react';
import Statistics from './StatElement';

const StatisticsList = (statisticsData) => (
    statisticsData.map((stat) => (
        <Statistics
            label={stat.label}
            percentage={stat.percentage}
        />
    )))

export default StatisticsList;
